import Link from 'next/link';

export default function Docs() {
  return (
    <div>
      <p>Hello Docs</p>
      <p>
        <Link href="/about">
          <a>
            Go to <strong>docs/about</strong>
          </a>
        </Link>
      </p>
      <p>
        <Link href="../" as="/" replace>
          <a>Return to home</a>
        </Link>
      </p>
    </div>
  );
}
